import axios from "axios";
export const userDetails=async()=>{
    try{
        const response=await axios.post("/api/auth/login",{
            "email": "adarshbalika@gmail.com",
            "password": "adarshbalika",
        });
        return response.data.products;
    }
    catch(e){
        console.log(e);
    }
}
